import React from "react";

export default function Trainers(){
    return(
        <div>
        <h1 align="center" className="trainers--h1">OUR TRAINERS</h1>
          <div className="trainer--wrapper">
           <img src="images/gym2.jpg" className="trainer--image" alt="" />
           <img src="images/gym3.jpg" className="trainer--image" alt="" />
           <img src="images/gym4.jpg" className="trainer--image" alt="" />
          </div>

        </div>
    )
}
